import React, { useState } from 'react';
import api from '../../services/api';

const presets = [
  { label: 'Quick (-T4 -F)', value: '-T4 -F' },
  { label: 'Service Detect (-sV)', value: '-sV' },
  { label: 'Aggressive (-T4 -A -v)', value: '-T4 -A -v' },
  { label: 'Vuln Scripts (--script=vuln)', value: '--script=vuln' },
];

interface PortInfo {
  port: number;
  state: string;
  service: string;
  version?: string;
}

const NmapScanner: React.FC = () => {
  const [target, setTarget] = useState('');
  const [options, setOptions] = useState('-sV');
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState<string>('');
  const [openPorts, setOpenPorts] = useState<PortInfo[]>([]);
  const [error, setError] = useState<string | null>(null);
  const [isScanning, setIsScanning] = useState(false);
  const [scanProgress, setScanProgress] = useState(0);

  const parseNmapOutput = (output: string): PortInfo[] => {
    const portRegex = /(\d+)\/tcp\s+(\w+)\s+(\S+)(?:\s+(.+))?/g;
    const ports: PortInfo[] = [];
    let match;

    while ((match = portRegex.exec(output)) !== null) {
      ports.push({
        port: parseInt(match[1]),
        state: match[2],
        service: match[3],
        version: match[4]?.trim()
      });
    }

    return ports;
  };

  const startScan = async () => {
    if (!target) {
      setError('Please enter a target to scan');
      return;
    }

    setLoading(true);
    setError(null);
    setResult('');
    setOpenPorts([]);
    setIsScanning(true);
    setScanProgress(0);

    // Simulate progress (since we can't get real-time progress from the API)
    const progressInterval = setInterval(() => {
      setScanProgress(prev => Math.min(prev + Math.random() * 10, 90));
    }, 1000);

    try {
      const res = await api.post('/nmap/scan', { target, options });
      setResult(res.data?.results || '');

      // Parse the results to extract open ports
      if (res.data?.results) {
        const ports = parseNmapOutput(res.data.results);
        setOpenPorts(ports);
      }

      setScanProgress(100);
    } catch (e: any) {
      const errorMsg = e?.response?.data?.error || 'Scan failed';
      setError(`${errorMsg}. ${e?.response?.data?.details || ''}`.trim());
      console.error('Nmap scan error:', e);
    } finally {
      clearInterval(progressInterval);
      setLoading(false);
      setIsScanning(false);
    }
  };

  const getPortStateColor = (state: string) => {
    switch (state.toLowerCase()) {
      case 'open': return '#10b981';
      case 'filtered': return '#f59e0b';
      case 'closed': return '#6b7280';
      default: return '#9ca3af';
    }
  };

  return (
    <div>
      <h2 style={{ marginTop: 0 }}>Nmap</h2>
      <p className="ll-muted">Scan targets for open ports and services.</p>

      <div className="ll-card ll-card--purple" style={{ marginTop: 12 }}>
        <div className="ll-grid" style={{ maxWidth: 860 }}>
          <input
            className="ll-input"
            value={target}
            onChange={(e) => setTarget(e.target.value)}
            placeholder="Target (e.g., 192.168.1.1 or example.com)"
          />

          <div className="ll-row" style={{ flexWrap: 'wrap' }}>
            {presets.map(p => (
              <button
                className="ll-button"
                key={p.value}
                onClick={() => setOptions(p.value)}
                style={{ filter: options === p.value ? 'brightness(1.05)' : undefined }}
              >
                {p.label}
              </button>
            ))}
          </div>

          <div className="ll-row">
            <input
              className="ll-input"
              value={options}
              onChange={(e) => setOptions(e.target.value)}
              placeholder="Custom options"
              style={{ flex: 1 }}
            />
            <button className="ll-button" onClick={startScan} disabled={loading || !target}>
              {loading ? 'Scanning...' : 'Start Scan'}
            </button>
          </div>
        </div>
        {error && <div style={{ color: '#f87171', marginTop: 10 }}>{error}</div>}
      </div>

      {result && (
        <div className="ll-card ll-card--purple" style={{ marginTop: 12 }}>
          <pre>{result}</pre>
        </div>
      )}
    </div>
  );
};

export default NmapScanner;
